select max(count) from (select part.P_PARTKEY,count(*) from part group by part.P_PARTKEY) as t;
select max(count) from (select partsupp.PS_SUPPKEY, partsupp.PS_PARTKEY, count(*) from partsupp , part where part.P_PARTKEY=partsupp.PS_PARTKEY group by partsupp.PS_SUPPKEY, partsupp.PS_PARTKEY) as t;
select max(count) from (select supplier.S_SUPPKEY,count(*) from supplier group by supplier.S_SUPPKEY) as t;
select max(count) from (select lineitem.L_SUPPKEY, lineitem.L_PARTKEY, lineitem.L_ORDERKEY, count(*) from lineitem, part where lineitem.L_PARTKEY=part.P_PARTKEY group by lineitem.L_SUPPKEY, lineitem.L_PARTKEY,lineitem.L_ORDERKEY) as t;
select max(count) from (select orders.O_ORDERKEY,count(*) from orders group by orders.O_ORDERKEY) as t;
select max(count) from (select partsupp.PS_SUPPKEY, partsupp.PS_PARTKEY, count(*) from partsupp , supplier, part where partsupp.PS_SUPPKEY=supplier.S_SUPPKEY and part.P_PARTKEY=partsupp.PS_PARTKEY group by partsupp.PS_SUPPKEY, partsupp.PS_PARTKEY) as t;
select max(count) from (select lineitem.L_SUPPKEY, lineitem.L_ORDERKEY, count(*) from lineitem, partsupp,part where  partsupp.PS_PARTKEY=lineitem.L_PARTKEY and partsupp.PS_SUPPKEY=lineitem.L_SUPPKEY and part.P_PARTKEY=lineitem.L_PARTKEY group by lineitem.L_SUPPKEY, lineitem.L_ORDERKEY) as t;
select max(count) from (select lineitem.L_SUPPKEY, lineitem.L_PARTKEY, lineitem.L_ORDERKEY, count(*) from lineitem, supplier, part where lineitem.L_SUPPKEY=supplier.S_SUPPKEY and part.P_PARTKEY=lineitem.L_PARTKEY group by lineitem.L_SUPPKEY, lineitem.L_PARTKEY,lineitem.L_ORDERKEY) as t;
select max(count) from (select lineitem.L_SUPPKEY, lineitem.L_PARTKEY, count(*) from lineitem, orders,part where lineitem.L_ORDERKEY=orders.O_ORDERKEY and part.P_PARTKEY=lineitem.L_PARTKEY group by lineitem.L_SUPPKEY, lineitem.L_PARTKEY) as t;
select max(count) from (select lineitem.L_ORDERKEY, count(*) from lineitem, partsupp,supplier,part where  partsupp.PS_PARTKEY=lineitem.L_PARTKEY and partsupp.PS_SUPPKEY=lineitem.L_SUPPKEY and lineitem.L_SUPPKEY=supplier.S_SUPPKEY and part.P_PARTKEY=lineitem.L_PARTKEY group by lineitem.L_ORDERKEY) as t;
select max(count) from (select lineitem.L_SUPPKEY, count(*) from lineitem, partsupp, orders, part where  partsupp.PS_PARTKEY=lineitem.L_PARTKEY and partsupp.PS_SUPPKEY=lineitem.L_SUPPKEY and lineitem.L_ORDERKEY=orders.O_ORDERKEY and part.P_PARTKEY=partsupp.PS_PARTKEY group by lineitem.L_SUPPKEY) as t;
select max(count) from (select lineitem.L_SUPPKEY, lineitem.L_PARTKEY, count(*) from lineitem, supplier,orders,part where lineitem.L_SUPPKEY=supplier.S_SUPPKEY and lineitem.L_ORDERKEY=orders.O_ORDERKEY and part.P_PARTKEY=lineitem.L_PARTKEY group by lineitem.L_SUPPKEY, lineitem.L_PARTKEY) as t;
